function HeaderComponent(props) {
  return (
    <div className="header-container">
      <h1 className="header">{props.name}</h1>
      <br/>
      <br/>
      <h3 className="subheader">{props.subheader}</h3>
    </div>
  )
}

export default HeaderComponent;
